import './css/Home.css';

export class Home extends Component {

    render() {

        return (
            <div className="home">

                {this.props.items.phones.map((id) =>{
                     for(i = 0;i < 3; i++){<h6>{id.id}</h6>} 
                })}
            </div>

        )
    }
}

export default Home;
